function CharacterList(props) {

const characterElement = props.characters.map((character) => {
    return (
        <li className="card">
            <a href="#">
                <img className="img_card" src={character.image} 
                alt={`Foto de ${character.name}`}
                title={`Foto de ${character.name}`}></img>
<h3 className="name_card">{character.name}</h3>
<p className="species_card">{character.species}</p>

            </a>


        </li>

    )
});

return (
    <section>
<ul className="cards">
  {characterElement}
</ul>

    </section>
)


}

export default CharacterList;
